showSelectFiles = function showSelectFiles(_event){

	var filelistTag = ''

	try
	{
		var selectlist = _event.target.files;
		if(null == selectlist){
			return;
		}


		for(i = 0; i < selectlist.length; ++i){
			if(null == selectlist[i]){
				continue;
			}
			selectlist += "<li>"+selectlist[i].name+"</li>";
		}

		var filelist = document.getElementById("filelist");
		if(null != filelist){
			filelist.innerHTML = filelistTag;	
		}
	}
	catch( _e )
	{
		console.log(_e);
	}
}
